(lib.mc_game = function(mode,startPosition,loop,reversed) {
if (loop == null) { loop = true; }
if (reversed == null) { reversed = false; }
	var props = new Object();
	props.mode = mode;
	props.startPosition = startPosition;
	props.labels = {};
	props.loop = loop;
	props.reversed = reversed;
	cjs.MovieClip.apply(this,[props]);

	this.isSingleFrame = false;
	// timeline functions:
	this.frame_0 = function() {
		if(this.isSingleFrame) {
			return;
		}
		if(this.totalFrames == 1) {
			this.isSingleFrame = true;
		}
		/* Se crear un arreglo llamado data que alberga 3 objetos que representan a las preguntas */
		var data = [ 
		  {
		    question_text: "What time do you wake up?",
		    answer: "0",
		    answers: ["At 7 o’clock", "Blue", "Dog"]
		  },
		  {
		    question_text: "Choose the correct verb: I ____ to school.",
		    answer: "1",
		    answers: ["Eat", "Go", "Sleep"]
		  },
		  {
		    question_text: "Which one is a color?",
		    answer: "2",
		    answers: ["Run", "Apple", "Green"]
		  },
		  {
		    question_text: "What is the plural of 'child'?",
		    answer: "1",
		    answers: ["Childs", "Children", "Childes"]
		  },
		  {
		    question_text: "Choose the correct sentence:",
		    answer: "0",
		    answers: ["She likes pizza.", "She like pizza.", "She liking pizza."]
		  },
		
		  /* NUEVAS 10 PREGUNTAS */
		
		  {
		    question_text: "What is the opposite of 'big'?",
		    answer: "1",
		    answers: ["Tall", "Small", "Fast"]
		  },
		  {
		    question_text: "Choose the correct word: I have ____ apple.",
		    answer: "2",
		    answers: ["A", "An", "An"]
		  },
		  {
		    question_text: "Which one is an animal?",
		    answer: "0",
		    answers: ["Dog", "Chair", "Book"]
		  },
		  {
		    question_text: "Complete: She ____ happy.",
		    answer: "1",
		    answers: ["Am", "Is", "Are"]
		  },
		  {
		    question_text: "What color is the sun?",
		    answer: "2",
		    answers: ["Blue", "Green", "Yellow"]
		  },
		  {
		    question_text: "Choose the correct sentence:",
		    answer: "0",
		    answers: ["They are friends.", "They is friends.", "They be friends."]
		  },
		  {
		    question_text: "How many days are in a week?",
		    answer: "1",
		    answers: ["Five", "Seven", "Ten"]
		  },
		  {
		    question_text: "Which one is a fruit?",
		    answer: "2",
		    answers: ["Car", "Table", "Apple"]
		  },
		  {
		    question_text: "Complete: I ____ 11 years old.",
		    answer: "0",
		    answers: ["Am", "Is", "Are"]
		  },
		  {
		    question_text: "What do you use to write?",
		    answer: "1",
		    answers: ["Shoe", "Pencil", "Apple"]
		  }
		];
		
		var indexQuestion = 0;
		var currentDataQuestion = data[indexQuestion];
		var isAnswered = false;
		var score = 0;
					 
		loadQuestion.bind(this)();
		/*Carga la pregunta actual almacenada en currentDataQuestion */
		function loadQuestion() {
			this.question.gotoAndPlay("appear");
			this.question.txt_question.text = currentDataQuestion.question_text;
			this.question.answer0.txt_answer.text = currentDataQuestion.answers[0];
			this.question.answer1.txt_answer.text = currentDataQuestion.answers[1];
			this.question.answer2.txt_answer.text = currentDataQuestion.answers[2];
			
			this.question.answer0.gotoAndStop(0);
			this.question.answer1.gotoAndStop(0);
			this.question.answer2.gotoAndStop(0);
		}
		
		this.question.answer0.on("click" , onClickAnswer.bind(this));
		this.question.answer1.on("click" , onClickAnswer.bind(this));
		this.question.answer2.on("click" , onClickAnswer.bind(this));
		
		function onClickAnswer(e)
		{
			if (isAnswered == false)
			{
				var item = e.currentTarget;
				// item.name : devuelve el nombre de la referencia al cual se hizo click
				if (item.name == "answer" + currentDataQuestion.answer) // Ejemplo : 'asnwer0' == 'answer0' 
				{
					item.gotoAndStop("good");
					score += 100;
					this.txt_score.text = score;
				} else {
					item.gotoAndStop("bad");
				}
				
				isAnswered = true;
			
			
				/* Se ejecuta una secuencia de acciones ,
				   después de un segundo cambiará al estado del mc_question a 'out',
				   despues de otros 600 milisegundos cargará la siguiente pregunta
				*/
				createjs.Tween.get(this)
					.wait(1000)
					.call( function() {
						this.question.gotoAndPlay("out");
					}.bind(this))
					.wait(600)
					.call(loadNextQuestion.bind(this));
				
			}
		}
		/*Carga la siguiente pregunta , si ya no existe mas preguntas
		  cargará la interface over
		*/
		function loadNextQuestion(e)
		{
			indexQuestion++;
			if (indexQuestion == data.length) 
			{
				stage.SCORE = score;
				this.parent.changePage(new lib.mc_over());
			}
			else {
				currentDataQuestion = data[indexQuestion];
				isAnswered = false;
				loadQuestion.bind(this)();
			}
		}
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1));

	// Capa_5
	this.txt_score = new cjs.Text("0", "bold 13px 'Verdana'", "#0000FF");
	this.txt_score.name = "txt_score";
	this.txt_score.textAlign = "center";
	this.txt_score.lineHeight = 18;
	this.txt_score.lineWidth = 65;
	this.txt_score.parent = this;
	this.txt_score.setTransform(49.5,131);

	this.timeline.addTween(cjs.Tween.get(this.txt_score).wait(1));

	// Capa_3
	this.question = new lib.mc_question();
	this.question.name = "question";
	this.question.setTransform(254.4,173.65,0.9651,0.9143,0,0,0,200.1,175.2);

	this.timeline.addTween(cjs.Tween.get(this.question).wait(1));

	// Capa_1
	this.instance = new lib.CachedBmp_67();
	this.instance.setTransform(8,102,0.5,0.5);

	this.timeline.addTween(cjs.Tween.get(this.instance).wait(1));

	// fondo
	this.instance_1 = new lib.Mapadebits40();
	this.instance_1.setTransform(4,5,0.7813,1.0539);

	this.timeline.addTween(cjs.Tween.get(this.instance_1).wait(1));

	this._renderFirstFrame();

}).prototype = getMCSymbolPrototype(lib.mc_game, new cjs.Rectangle(4,5,500,450), null);


